window.bookSummaryJSON = "<p>Catie is on her way back to Earth after having settled the Fazulan slaves when the wormhole her ship is traveling in collapses. They are diverted to another system, where big chunks are flying around. They rescue a ship and find themselves in the middle of a series of mysteries. Catie resigns herself to continuing her role as Princess Catie and helping these people solve their problems so that this new system can join the Delphi League. And Catie gets exactly what she asked for.</p>"; 
